import React from 'react';
import './layout.scss'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import { Dashboard } from './Components/Dashboard/Dashboard';
import { Navigation } from './Components/Navigation/Navigation';

function App() {
  return (
    <Router>
    <div className="app">
      <div class="layout">
        <Navigation/>
        <Dashboard />  
      </div>  
    </div>

      <Switch>
        <Route path="/about">
          <About />
        </Route>
        <Route path="/users">
          <Users />
        </Route>
        <Route path="/">
          <Home />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
